import React from 'react';
import {Slider} from '@mui/material';

function Predict() {
    return (
        <div>
            <Slider aria-label="Temperature" defaultValue={30} valueLabelDisplay="auto" step={10} marks min={10} max={110} width={20}/>
        </div>
    )
}

export default Predict;
